<?php
require_once("../bootstrap.php");
use Qiniu\Storage;
use Qiniu\Http\Client;
//简单无key数据上传

$data = "";
$auth = new \Qiniu\Auth($QINIU_ACCESS_KEY, $QINIU_SECRET_KEY);
$up_token = $auth->uploadToken($QINIU_PUBLIC_BUCKET);
$key="2015/05/28/qiniu.png";
$fsize=strlen(base64_decode($data));
$mimeType="image/png";
$postUrl="http://upload.qiniu.com/putb64/".$fsize.
    "/key/".\Qiniu\base64_urlSafeEncode($key).
    "/mimeType/".\Qiniu\base64_urlSafeEncode($mimeType);
$headers=array(
    "Authorization"=>"UpToken ".$up_token,
    "Content-Type"=>"application/octet-stream",
);
$response=Client::post($postUrl,$data,$headers);
print_r($response);